import React from 'react';
import { SafeAreaView, StyleSheet, Text, View } from 'react-native';
import { FlatList } from 'react-native-gesture-handler';

const SkinSearchResults = props =>{

    const results = props.route.params.skinResults
    // const results = [
    //     {skinName: "asdas", rarity: "dasdad", icon_url: "sadasds"},
    //     {skinName: "asdas", rarity: "dasdad", icon_url: "sadasds"},
    //     {skinName: "asdas", rarity: "dasdad", icon_url: "sadasds"}
    // ]

    const DATA = [
        {
          id: 'bd7acbea-c1b1-46c2-aed5-3ad53abb28ba',
          title: 'First Item',
        },
        {
          id: '3ac68afc-c605-48d3-a4f8-fbd91aa97f63',
          title: 'Second Item',
        },
        {
          id: '58694a0f-3da1-471f-bd96-145571e29d72',
          title: 'Third Item',
        },
      ];
    
    // console.log(results)
    // const Item = ({skinName, icon_url, rarity}) =>(
    //     <View>
    //         <Text>{skinName}</Text>
    //         <Text>{rarity}</Text>
    //     </View>
    // )

    // const renderItem = ({item}) => (
    //     <Item 
    //         skinName = {item.skinName}
    //         icon_url = {item.icon_url}
    //         rarity = {item.rarity}
    //     />
    // )
    
    const Item = ({ skinName, icon_url, rarity }) => (
        <View>
             <Text>{skinName}</Text>
             <Text>{rarity}</Text>
         </View>
      );

      const renderItem = ({ item }) => (
        <Item 
            skinName = {item.skinName}
            icon_url = {item.icon_url}
            rarity = {item.rarity}
        />
      );
      

    return(
        <SafeAreaView>
            {/* <Item skinName={results[0].skinName} rarity={results[0].rarity}/> */}
            {/* <FlatList>
                data = {results}
                renderItem = {renderItem}
                keyExtractor = {item => item.id}
            </FlatList> */}
            <FlatList
        data={results}
        renderItem={renderItem}
        keyExtractor={item => item.id}
      />

        </SafeAreaView>
    )
}

export default SkinSearchResults
